const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Berserker</li><li>True Name: Frankenstein (to be exact nameless, Frankenstein\u2019s Monster)</li><li>Gender: Female</li><li>Source: Literary work \u300EFrankenstein; or, The Modern Prometheus\u300F</li><li>Origin: Europe</li><li>Alignment: Chaotic Neutral</li><li>Height: 172 cm</li><li>Weight: 48 kg</li></ul><p><strong>Meta</strong></p><ul><li>Scenario writer: Hoshizora Meteo</li><li>Character designer: Okazaki Takeshi</li><li>CV: Nonaka Ai</li><li>Major appearances: Fate/Apocrypha</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">C</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Mad Enhancement: [D]</strong></p><p>Raises the Strength and Endurance parameters, but language ability becomes simple, and continuing complex thoughts becomes difficult.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Lament of the Hollow Living: [D]</strong></p><p>A shrill shout that can\u2019t be known when will end and that increases while on Mad Enhancement.</p><p>It deprives enemies and allies without distinction of their ability to think, and those without the capacity to resist will panic and become unable to breathe.</p><p><strong>Galvanism: [B]</strong></p><p>Free conversion, as well as accumulation, of electric current and mana from living organisms.</p><p>It invalidates attacks without substance like magical light, magical wind, or magical bullets, by instantly converting them into electricity and discharging it into the environment.</p><p>Also, the body is strengthened depending on the amount of stored electricity, and the repair of damage is done more quickly.</p><p><strong>Overload: [C]</strong></p><p>An intentional boost up while being aware of suffering damage.</p><p>In Frankenstein\u2019s case, she converts the mana accumulated with Galvanism into more electricity than the maximum permissible level, and bounces the attack power of her Noble Phantasm up by outputting all of it.</p><p>Since her body can\u2019t bear it, she suffers damage.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="bridal-chest-maiden-s-chastity" tabindex="-1"><a class="header-anchor" href="#bridal-chest-maiden-s-chastity" aria-hidden="true">#</a> Bridal Chest - Maiden\u2019s chastity</h1><ul><li>Rank: C</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 1</li><li>Maximum number of targets: 1 person</li></ul><p>Bridal Chest.</p><p>A tree branch-shaped war hammer (mace) wrapped in discharged current.</p><p>The sphere at the tip is her heart itself, and she keeps it close to her even outside battle.</p><p>It works by making electric supply occur through the fin at the head of the original body and the fin at the rear part.</p><p>Since it efficiently collects and accumulates wasted mana from herself and the environment, in battle, where surplus of mana keeps occurring abundantly in the surroundings, it can combine with Galvanism to pseudo-act as the \u300EType II Perpetual Engine\u300F.</p><p>(The True Name release won\u2019t happen in \u300EFateGO\u300F)</p><h1 id="blasted-tree-lightning-tree-of-crucifixion" tabindex="-1"><a class="header-anchor" href="#blasted-tree-lightning-tree-of-crucifixion" aria-hidden="true">#</a> Blasted Tree - Lightning Tree of Crucifixion</h1><ul><li>Rank: D~B</li><li>Type: Anti-Army Noble Phantasm</li><li>Range: 1~10</li><li>Maximum number of targets: 30 people</li></ul><p>Blasted Tree.</p><p>A full-power discharge occurred by thrusting\u300EMaiden\u2019s chastity\u300F into the ground and removing all the limiters. It pours down with the silhouette of a towering big tree, a diffuse homing thunder.</p><p>If the enemy is standing alone and at a short range, it can be activated even without \u201CMaiden\u2019s chastity\u201D. Although it\u2019s controlled through limiters, its power when they\u2019re canceled is overwhelming. But in that case, the user suspends their activity completely. That is, \u300Edeath\u300F.</p><p>This thunder attack has a low chance of the possibility of giving birth to a second Frankenstein Monster.</p><p>Although, she who has died can\u2019t see that result.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First person pronoun: \u308F\u305F\u3057 (watashi)</li><li>Second person pronoun: None</li><li>Third person pronoun: None</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>If she was to be compared with something, it\u2019d kind of be a large-breed dog that distrusts humans.</p><p>There\u2019s wisdom, but since she\u2019s a Berserker anyhow, she can\u2019t convey her own feelings.</p><p>Since saying a single word isn\u2019t an average difficulty, she seldom speaks.</p><p>Her hobby is saving electricity, so wasting it is forbidden.</p><p>Also, since her regulation of emotional control is not going well, there are times when she displays a ferocious personality.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>In order to become as human as possible, she draws near the Master and learns how to be human.</p><p>Although grumpy, she\u2019s a good girl Servant that will respond to conversations properly if she sincerely gets along with you.</p><p>However, in order to transmit will through hand signals and gesticulations, the Master must improve their gesture skills.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u300ENaaaaaaaaaaoooooo!!\u300F</p><p>\u300EUu\u2026\u2026 Uuuuuuh!!\u300F</p><p>\u300EWith me, together, come\u300F</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>Originally a character in Mary Shelley\u2019s novel \u300EFrankenstein; or, the modern Prometheus\u300F, a nameless monster.</p><p>A man-made life form produced by the doctor Victor Frankenstein by patching corpses, in addition to the power of thunderbolts.</p><p>In the novel, she\u2019s a scientifically cast monster, but in this work Victor Frankenstein himself isn\u2019t fictional, he exists in someone as a man who made an artificial human by fusing alchemy and science.</p><p>The purpose of creating an artificial human was to recreate the primeval human Adam. That is, \u300Eshe\u300F who is summoned as a Servant was cast as an Eve that would conceive Adam.</p><p>However, that ended in failure. Doctor Frankenstein made a failed work, a girl that displayed a tremendous ferocity and couldn\u2019t control her emotions.</p><p>The problem was that the doctor himself thought she was a helpless monster no one could lay a hand on.</p><p>And, the doctor Frankenstein, by no means a fool who lacked emotions and could only display a ferocious personality, escaped without acknowledging her.</p><p>The reason of her existence, the purpose of Eve \u2015\u2015\u2015 that is, becoming the mother of Adam, was announced by the doctor. But in order to do that, a companion was needed above all, and the only one that could create that companion was the doctor Frankenstein alone.</p><p>An interminable chase drama.</p><p>She announces. That the doctor has the responsibility and the crime.</p><p>The responsibility of having created me, and the crime of having abandoned me \u2015\u2015\u2015</p><p>Although the doctor refused by saying there was no way he could create two monsters in this world, the girl that he once established as a target, exerted her ferocity and persistently demanded.</p><p>She killed the doctor\u2019s family, but even so the doctor, far from claiming revenge, ran and ran away.</p><p>Why don\u2019t you hate me?</p><p>Why don\u2019t you look at me?</p><p>Following the runaway doctor she went to the South Pole, in front of the doctor who chose death while fearing and rejecting, the girl finally despaired that she couldn\u2019t be human.</p><p>That\u2019s why, she entrusted the Holy Grail.</p><p>To bring a companion that would make her human.</p><p>Though \u2015\u2015\u2015 Some time is necessary for her to realize that, that itself, is her encounter with the Master.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Mordred</strong></p><p>Doesn\u2019t know well the reason, but she seeks attention in one way or another.</p><p><strong>Edison and Nikola Tesla</strong></p><p>Loving electricity is good, but she wants them to conserve it.</p><p><strong>Charles Babbage</strong></p><p>Friend? Grandpa? Big kettle? Mm, don\u2019t know.</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>This Frankenstein is one from among the 3 patterns I proposed. At first, she didn\u2019t have a neck, a design in which the head looked like it was hanging down because of the metal fixtures of the collar and ears. Notes about the difficult to see eyes being mismatched in color, and the heart being inside the mace, were included in the initial draft. Thank goodness you have a neck in the end, Fran-chan. (Okazaki Takashi)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-080.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-081.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-082.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-083.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-084.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-085.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-086.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-087.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-088.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-III/i-089.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 97);
